axAmount\") as Extendedcost\n\nunion all \n\nselect ''TAX FFD'' as ItemNumber,\n@Model.GetVal(\"Invoice\",\"SalesTaxAmount\") as Extendedcost\n\nunion all \n\nselect ''LINE RENT'' as ItemNumber,\n@Model.GetVal(\"Invoice\",\"LineRent\") as Extendedcost\n\nunion all \n\nselect ''OTC CHR'' as ItemNumber,\n@Model.GetVal(\"Invoice\",\"OTC\") as Extendedcost\n\n)\n\nINSERT INTO [dbo].[GP_Invoice]\n           ([InvoiceNumber]\n           ,[InvoiceDate]\n           ,[ItemNumber]\n           ,[Extendedcost]\n           ,[CustomerGPID]\n           ,BranchGPID\n           ,[ContractID]\n           ,[Service]\n           ,[RecordStatus]\n           ,[FromDate]\n           ,[ToDate]\n           ,[Currency]\n           ,[TotalincomingDuration]\n           ,[TotalOutgoingDuration])\n\nselect \t   ''@Model.GetVal(\"Invoice\",\"SerialNumber\")'',\n           ''@Model.GetVal(\"Invoice\",\"IssueDate\").Date.ToString(\"yyyy-MM-dd\")'',\n           i.ItemNumber,\n           ROUND(i.Extendedcost,0),\n           ''@Model.GetVal(\"Account\",\"CompanySiteId\")'',\n           ''@Model.GetVal(\"Account\",\"BranchSiteId\")'',\n           ''@Model.GetVal(\"Account\",\"BranchContractId\")'',\n           ''FLL'',\n           0,\n           ''@Model.GetVal(\"Invoice\",\"FromDate\").Date.ToString(\"yyyy-MM-dd\")'',\n           ''@Model.GetVal(\"Invoice\",\"ToDate\").Date.ToString(\"yyyy-MM-dd\")'',\n           ''@Model.GetVal(\"Invoice\",\"Currency\")'',\n           @Model.GetVal(\"Invoice\",\"IncomingDurationInSec\"),\n           @Model.GetVal(\"Invoice\",\"OutgoingDurationInSec\")\nfrom Invoicetoinsert i\nwhere  ROUND(i.Extendedcost,0) > 0"},"LoggingMessageTemplate":{"$type":"Vanrise.Entities.VRExpression, Vanrise.Entities","ExpressionString":"Invoice ''@Model.GetVal(\"Invoice\",\"SerialNumber\")'' for Account ''@Model.GetVal(\"Account\",\"Name\")'' is uploaded to GP"},"ExceptionMessageTemplate":{"$type":"Vanrise.Entities.VRExpression, Vanrise.Entities","ExpressionString":"Failed to upload Invoic